<script setup>
import CustomerHeader from "@/views/Customer/component/CustomerHeader.vue";
import Cfooter from "@/views/Customer/component/Cfooter.vue";
import {onMounted, reactive, ref} from "vue";
import axios from "axios";
import base_url from "@/store/constants";
import router from "@/router";


import {useCustomerStore} from "@/store/useCustomerStore"
import {ElMessage} from "element-plus";

const customerStore = useCustomerStore(); // 获取 useCustomerStore 的实例

const AllData = ref([])

onMounted(() => {

  getAll()

})

const getAll = async () => {

  var res = await axios.get(base_url + `/sys/shop/getall`)
  AllData.value = res.data
  console.log(AllData)

}

const toShop = (item) => {

  let text = router.resolve({name: 'Shop', query: {keyword: item.shopId}});
  window.open(text.href, '_blank');

}

let dialogVisible = ref(false)

let updateForm = reactive({

  customerName: customerStore.customer.customerName,
  loc: ''

})
let currentItem = ref()
const changeLoc = async () => {


  var res = await axios.post(base_url + `/sys/customer/searchLoc?name=${customerStore.customer.customerName}`)
  updateForm.loc = res.data
  currentItem = res.data
  dialogVisible.value = true

}


const handleConfirm = async () => {

  await axios.post(base_url + '/sys/customer/changeLoc', updateForm)
  ElMessage({
    message: '修改成功',
    type: 'success',
  })
  dialogVisible.value = false

}


const rules = reactive({
  loc: [
    {required: true, message: '请输入新地址', trigger: 'blur'},
  ]
})

const toHP = () => {

  let text = router.resolve({name: 'CshopList', query: {keyword: '汉堡披萨'}});
  window.open(text.href, '_blank');


}

</script>

