  <el-dialog
      v-model="dialogVisible"
      title="修改地址"
  >

    <el-form
        ref="updateFormRef"
        :model="updateForm"
        :rules="rules"
        label-width="80px"
        class="demo-ruleForm"
        status-icon
    >

      <el-form-item label="新地址" prop="itemName">
        <el-input v-model="updateForm.loc" :value="currentItem"/>
      </el-form-item>


    </el-form>

    <template #footer>
      <span class="dialog-footer">
        <el-button @click="dialogVisible = false">取消</el-button>
        <el-button type="primary" @click="handleConfirm()">
          确定
        </el-button>
      </span>
    </template>
  </el-dialog>

